import React , { useState } from "react";
import { Form, Input, Button ,InputNumber, DatePicker } from "antd";
import { connect } from "react-redux";
import axios from "axios";
import ApplicantLayout from "../../containers/templates/applicant/applicantlayout"
import axiosInstance from "../connection";

const FormItem = Form.Item;


export default function BusinessCreateForm () {

  // const history = useHistory();
	const initialFormData = Object.freeze({
		business_name: '',
		phone_number: '',
		industry: '',
    email: '',
    director_first_name: '',
    director_last_name: '',
    director_other_name: '',
    director_phone_number: '',
    director_email: '',
    time: '',
	});

	const [formData, updateFormData] = useState(initialFormData);

	const handleChange = (e) => {
		updateFormData({
			...formData,
			// Trimming any whitespace
			[e.target.name]: e.target.value.trim(),
		});
	};

	const handleSubmit = (e) => {
		e.preventDefault();
		console.log(formData);

		axiosInstance
			.post(`business/Business/`, {
			business_name: formData.business_name,
			phone_number:formData.phone_number,
		  industry:formData.industry,
      email:formData.email,
      director_first_name:formData.director_first_name,
      director_last_name:formData.director_last_name,
      director_other_name:formData.director_other_name,
      director_phone_number:formData.director_phone_number,
      director_email:formData.director_email,
      time:formData.time,

			})
			// .then((res) => {
			// 	history.push('/login');
			// 	console.log(res);
			// 	console.log(res.data);
			// });
	};

	// const classes = useStyles();



    return (
      <div>
          <ApplicantLayout>
        <Form>

          <FormItem label="Business Name">
            <Input 
            id="business_name"
            name="business_name" 
						label="Business Name"
						onChange={handleChange}
            placeholder="Input a business name here" 
            />
          </FormItem>

          <FormItem label="Phone Number">
            <Input 
            id="phone_number"
            name="phone_number" 
						label="Phone Number"
						onChange={handleChange}
            placeholder="Input a business phone number here" 
            />
          </FormItem>

          <FormItem label="Industry">
            <Input 
            id="industry"
            name="industry" 
						label="Industry"
						onChange={handleChange}
            placeholder="Input a business industry here" 
            />
          </FormItem>


          <FormItem label="Other Name">
            <Input name="Other_Names" placeholder="Enter some content ..." />
          </FormItem>

          <FormItem label="Last Name">
            <Input name="Last_name" placeholder="Enter some content ..." />
          </FormItem>

          <FormItem label="Email">
            <Input name="Email" placeholder="Enter some content ..." />
          </FormItem>

        <Form.Item label="Date of Birth">
        <DatePicker label="Date_of_birth" placeholder="Enter some content ..." />
        </Form.Item>

        <FormItem label="Id Number ">
            <Input name="Id_Number " placeholder="Enter some content ..." />
          </FormItem>

          <FormItem label="Phone Number">
            <Input name="Phone_Number" placeholder="Enter some content ..." />
          </FormItem>

          <FormItem label="Level of Education">
            <Input name="Level_of_Education" placeholder="Enter some content ..." />
          </FormItem>

          <FormItem label="Course">
            <Input name="Course" placeholder="Enter some content ..." />
          </FormItem>

          <FormItem label="Other Education">
            <Input name="Other_Education" placeholder="Enter some content ..." />
          </FormItem>

          <FormItem label="Previous Job ">
            <Input name="Previous_Job" placeholder="Enter some content ..." />
          </FormItem>

        <Form.Item label="Time Worked At Prevoius Job">
          <InputNumber  name="Time_Worked_There" placeholder="Enter some content ..."/>
        </Form.Item>

          <FormItem>
            <Button type="primary" htmlType="submit">
            Button
            </Button>
          </FormItem>

        </Form>
        </ApplicantLayout>
      </div>
    );

}

const mapStateToProps = state => {
  return {
    token: state.token
  };
};
